import './App.css';
import Weather from './weather';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form>
          <input type="text" placeholder="username"></input>
          <input type="password" placeholder="password"></input>
        </form>
      </header>
    </div>
  );
}

export default App;
